import React from 'react';
import './stil.css';
import { Button, Form, FormControl, Card} from "react-bootstrap";

class Home extends React.Component {
  render() {
    return (
      <div className="main-div">
            <Card style={{ width: '55rem' }} id="prva">
              <Card.Body>
                <Card.Title id="naslov">Welcome to the synonyms search tool</Card.Title>
                <Card.Text id="tekst">
                  Search synonyms
                  <Form>
                    <FormControl type="text" placeholder="Enter a word" id="bar" />
                    <Button variant="outline-success">Search</Button>
                  </Form>
                  
                  <Button variant="outline-success" id="add">Add your synonyms</Button>
                </Card.Text>
              </Card.Body>
            </Card>
      </div>
    );
  }
}

export default Home;
